import React from 'react';
import { useLogged } from '../App';

export function Home(props) {


    return (
        <div>
            {props.isLogged === true &&
                <div>
                    <p> user: {props.user}</p>
                    <p> password: {props.password}</p>
                </div>
            }
        </div>
    )
}
